import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const ExpenseForm = () => {
  const navigate = useNavigate();
  const [expense, setExpense] = useState({
    description: '',
    amount: '',
    category: '',
    tags: []
  });
  const [aiInsights, setAiInsights] = useState(null);
  const [error, setError] = useState(null);

  const categories = [
    'Food', 'Transport', 'Entertainment', 
    'Utilities', 'Housing', 'Healthcare', 
    'Education', 'Personal', 'Miscellaneous'
  ];

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    setAiInsights(null);

    // Validate input
    if (!expense.description || !expense.amount || !expense.category) {
      setError('Please fill in all required fields');
      return;
    }

    try {
      const response = await axios.post('http://localhost:5000/api/expenses', {
        description: expense.description,
        amount: parseFloat(expense.amount),
        category: expense.category,
        tags: expense.tags
      });

      // Extract AI insights from the response
      if (response.data.aiInsights) {
        setAiInsights(response.data.aiInsights);
      }

      // Reset form and show success message
      setExpense({
        description: '',
        amount: '',
        category: '',
        tags: []
      });

      // Optional: Navigate to expense list or show a success message
      navigate('/');
    } catch (error) {
      console.error('Error adding expense:', error);
      setError('Failed to add expense. Please try again.');
    }
  };

  return (
    <div className="expense-form-container">
      <h2>Add New Expense</h2>
      {error && <div className="error-message">{error}</div>}

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Description</label>
          <input
            type="text"
            placeholder="Expense description"
            value={expense.description}
            onChange={(e) => setExpense({...expense, description: e.target.value})}
            required
          />
        </div>

        <div className="form-group">
          <label>Amount</label>
          <input
            type="number"
            placeholder="Expense amount"
            value={expense.amount}
            onChange={(e) => setExpense({...expense, amount: e.target.value})}
            min="0"
            step="0.01"
            required
          />
        </div>

        <div className="form-group">
          <label>Category</label>
          <select
            value={expense.category}
            onChange={(e) => setExpense({...expense, category: e.target.value})}
            required
          >
            <option value="">Select Category</option>
            {categories.map(category => (
              <option key={category} value={category}>{category}</option>
            ))}
          </select>
        </div>

        <div className="form-group">
          <label>Tags (optional)</label>
          <input
            type="text"
            placeholder="Add tags (comma-separated)"
            value={expense.tags.join(', ')}
            onChange={(e) => setExpense({...expense, tags: e.target.value.split(',').map(tag => tag.trim())})}
          />
        </div>

        <button type="submit" className="submit-btn">
          Add Expense
        </button>
      </form>

      {aiInsights && (
        <div className="ai-insights">
          <h3>AI Insights</h3>
          <div>
            <strong>Sentiment:</strong> {aiInsights.sentiment}
          </div>
          <div>
            <strong>Recommendation:</strong> {aiInsights.recommendation}
          </div>
        </div>
      )}
    </div>
  );
};

export default ExpenseForm;
